import ExpenseItem from "./ExpenseItem";
import Card from '../UI/Card';
import "./ExpensePrice.css";
import ExpensesFilter from "./ExpensesFilter";
import { useState } from "react";


const Expenses = function (props) {
  const [year, changeYear] = useState(2020);

   const yearHandler = dataYear => {
      changeYear(dataYear);
    };
    return (
    <div>
      <Card className="expenses">
        <ExpensesFilter value={year} onChangeFilter={yearHandler} />
      <ExpenseItem title={props.items[0].title} amount={props.items[0].amount} date={props.items[0].date} />
      <ExpenseItem title={props.items[1].title} amount={props.items[1].amount} date={props.items[1].date} />
      <ExpenseItem title={props.items[2].title} amount={props.items[2].amount} date={props.items[2].date} />
      <ExpenseItem title={props.items[3].title} amount={props.items[3].amount} date={props.items[3].date} />
      <ExpenseItem title={props.items[4].title} amount={props.items[4].amount} date={props.items[4].date} /> 
        </Card>
    </div>
    );
}

export default Expenses;
